import React from 'react';
import Handsontable from 'handsontable';
import HandsontableReact from '@handsontable/react';
import 'handsontable/dist/handsontable.full.css';
import './StudentList.css'; 
const SimpleHandsontable = () => {
  const data = [
    ['', '', '', '', '', ''],
    ['', '', '', '', '', ''],
  ];

  return (
    <div style={{ width: '100%', height: '500px' }}>
      <HandsontableReact
        data={data}
        colHeaders={['Roll No', 'Name', 'Hostel', 'Year', 'Slot', 'Count']}
        rowHeaders
        width="100%"
        height="100%"
        licenseKey="non-commercial-and-evaluation" // Add your license key here
      />
    </div>
  );
};

export default SimpleHandsontable;
